import React, { useState, useEffect } from 'react';
import './AdminApp.css';

function AdminDashboard() {
  const [sessions, setSessions] = useState([]);
  const [sessionDates, setSessionDates] = useState({});
  const [kidDetails, setKidDetails] = useState({});

  // Fetch sessions from the API
  useEffect(() => {
    fetchSessions();
  }, []);

  const fetchSessions = async () => {
    try {
      const response = await fetch('http://localhost:5000/sessions'); // Update the API endpoint if needed
      if (!response.ok) {
        throw new Error('Failed to fetch sessions');
      }
      const data = await response.json();
      setSessions(data.sessions || []);
      setSessionDates(data.sessionDates || {});
      setKidDetails(data.kidDetails || {}); // Assuming "kidDetails" is part of the response
    } catch (error) {
      console.error('Error fetching sessions:', error);
    }
  };

  // Handle button click to get analysis for a session
  const handleSessionClick = (sessionId) => {
    console.log(`Get Analysis for Session ID: ${sessionId}`);
    // Add navigation or fetch logic for analysis here
  };

  // Format the date string
  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    const date = new Date(dateString);
    return date.toLocaleString();
  };

  return (
    <div className="dashboard-container">
      <h2>Admin Dashboard</h2>
      <div className="table-container">
        <table className="sessions-table">
          <thead>
            <tr>
              <th>Session ID</th>
              <th>Kid Details</th>
              <th>Created Date</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {sessions.length > 0 ? (
              sessions.map((session) => (
                <tr key={session}>
                  <td>{session}</td>
                  <td>{kidDetails[session] || 'No Details Available'}</td>
                  <td>{formatDate(sessionDates[session])}</td>
                  <td>
                    <button
                      onClick={() => handleSessionClick(session)}
                      className="get-analysis-btn"
                    >
                      Get Analysis
                    </button>
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="4" className="no-sessions">
                  No sessions available.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default AdminDashboard;
